define({"topics" : [{"title":"File Name Pattern and Mode","shortdesc":"\n               <p class=\"shortdesc\">Use a file name pattern to define the files that the MapR FS Standalone origin         processes. <span class=\"ph\">You can use either a glob pattern or a regular expression to define                 the file name pattern. </span></p>\n            ","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_hm4_vkh_ndb","attributes": {"data-id":"concept_hm4_vkh_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_hm4_vkh_ndb-d46e46412","topics":[]},{"title":"Read Order","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_ubc_blh_ndb","attributes": {"data-id":"concept_ubc_blh_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_ubc_blh_ndb-d46e46439","topics":[]},{"title":"Multithreaded Processing","shortdesc":"\n               <p class=\"shortdesc\">The MapR FS Standalone origin uses multiple concurrent threads to process data based         on the Number of Threads property.\n                  \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_x2d_4lh_ndb","attributes": {"data-id":"concept_x2d_4lh_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_x2d_4lh_ndb-d46e46471","topics":[]},{"title":"Reading from Subdirectories","shortdesc":"\n               <p class=\"shortdesc\">When using the Last Modified Timestamp read order, the MapR FS Standalone origin can         read files in subdirectories\n                  of the specified file directory. \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_vx1_rmh_ndb","attributes": {"data-id":"concept_vx1_rmh_ndb",},"menu": {"hasChildren":true,},"tocID":"concept_vx1_rmh_ndb-d46e46516","next":"concept_vx1_rmh_ndb-d46e46516",},{"title":"First File for Processing","shortdesc":"\n               <p class=\"shortdesc\">Configure a first file for processing when you want MapR FS Standalone to ignore one         or more existing files in the\n                  directory.\n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_bb4_cnh_ndb","attributes": {"data-id":"concept_bb4_cnh_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_bb4_cnh_ndb-d46e46637","topics":[]},{"title":"Record Header Attributes","shortdesc":"\n               <p class=\"shortdesc\">The MapR FS Standalone origin <span class=\"ph\">creates record header                 attributes that include <span class=\"ph\">information about the originating file for                     the record</span>.</span>     \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_uyy_nsn_ndb","attributes": {"data-id":"concept_uyy_nsn_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_uyy_nsn_ndb-d46e46713","topics":[]},{"title":"Event Generation","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_uqn_cjh_ndb","attributes": {"data-id":"concept_uqn_cjh_ndb",},"menu": {"hasChildren":true,},"tocID":"concept_uqn_cjh_ndb-d46e46805","next":"concept_uqn_cjh_ndb-d46e46805",},{"title":"Buffer Limit and Error Handling","shortdesc":"\n               <p class=\"shortdesc\">The MapR FS Standalone origin <span class=\"ph\">passes each record to a buffer. The size of the buffer determines                 the maximum size of the record that can\n                     be processed. Decrease the buffer limit when                 memory on the <span class=\"ph\">Data Collector</span>                 machine is limited. Increase the buffer limit to process larger records when memory                 is available.</span></p>\n            ","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_pjy_vsn_ndb","attributes": {"data-id":"concept_pjy_vsn_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_pjy_vsn_ndb-d46e47001","topics":[]},{"title":"Kerberos Authentication","shortdesc":"\n               <p class=\"shortdesc\"><span class=\"ph\">You can use Kerberos authentication to connect to MapR. When you                 use Kerberos authentication, <span class=\"ph\">Data Collector</span>                 uses the Kerberos principal and keytab to connect to MapR. By default, <span class=\"ph\">Data Collector</span>                 uses the user account who started it to connect.</span></p>\n            ","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_erj_1tn_ndb","attributes": {"data-id":"concept_erj_1tn_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_erj_1tn_ndb-d46e47122","topics":[]},{"title":"HDFS Properties and Configuration Files","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_nq2_j5n_ndb","attributes": {"data-id":"concept_nq2_j5n_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_nq2_j5n_ndb-d46e47255","topics":[]},{"title":"HDFS User","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_pdc_1wn_ndb","attributes": {"data-id":"concept_pdc_1wn_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_pdc_1wn_ndb-d46e47389","topics":[]},{"title":"Data Formats","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_jdp_gzn_ndb","attributes": {"data-id":"concept_jdp_gzn_ndb",},"menu": {"hasChildren":false,},"tocID":"concept_jdp_gzn_ndb-d46e47532","topics":[]},{"title":"Configuring a MapR FS Standalone Origin","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#task_tpv_kqc_mdb","attributes": {"data-id":"task_tpv_kqc_mdb",},"menu": {"hasChildren":false,},"tocID":"task_tpv_kqc_mdb-d46e47685","topics":[]}]});